def transform(sequence):
    transformed_sequence = list(sequence)
    count = 0
    for i in range(len(sequence)):
        if sequence[i] == '0':
            count += 1
        else:
            transformed_sequence[i - count] = sequence[i]
    for i in range(len(transformed_sequence)-count, len(transformed_sequence)):
        transformed_sequence[i] = '0'
    return ''.join(transformed_sequence)
